import React from 'react'

const Product = (product) => {

    const prod = product.product;
    const printProd = () => {
        prod.productCategory &&
            console.log(prod.productCategory?.category)
    }

    return (
        <>
            <div className="Product">
                <button onClick={printProd}>Print </button>
                <p><span>Name : {prod.productName}</span> </p>
                <p><span>Price :  {prod.productPrice}</span></p>
                <p><span>  Quantity :{prod.productQty} </span></p>
                <p><span> Description : {prod.productDescription}</span> </p>
                <p><span>     Category :{prod.productCategory?.category}</span></p>
                <hr />
            </div>
        </>
    )
}

export default Product
